import styled from 'styled-components';

export const ReleaseStyled = styled.div`
  width: 90%;
  display: flex;
  flex-direction: column;
  align-items: center;

  h1 {
    text-align: left;
  }

  h2 {
    text-align: left;
  }

  h3 {
    text-align: left;
  }

div {
  min-height: 200px;
  min-width: 200px;
  max-height: 200px;
  max-width: 200px;
}
  img {
    height: 100%;
    width: 100%;
    display: block
  }
`;
